import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Login from '../components/LoginDesign/Login';
import SignInForm from '../components/LoginDesign/SignInForm';
import SignUpForm from '../components/LoginDesign/SignUpForm';

export default function Routes() {
	return (
		<BrowserRouter>
			<Switch>
				<Login>
					<Route
						exact
						path="/"
						component={props => {
							return <SignUpForm {...props} />;
						}}
					/>
					<Route
						exact
						path="/sign-in"
						component={props => {
							return <SignUpForm {...props} />;
						}}
					/>
				</Login>
			</Switch>
		</BrowserRouter>
	);
}
